En tant que conseiller client, je vous recommande vivement de passer à une vitesse Internet de 20 Mbps ou plus. Pourquoi ? Parce que cela vous ouvre les portes des avantages préférentiels exclusifs offerts par notre convention. Convaincre le client : Cher client ! Profitez d'une connexion plus rapide pour télécharger des documents instantanément, gérer vos tâches en ligne avec une efficacité renforcée, pour une tarification exceptionnelle. Quel est le personnel ciblé par cette convention ? Les offres proposées par Algérie Télécom sont applicables au profit du personnel en activité relevant de L'Établissement E. Quel est le dossier à fournir ? Pour bénéficier des offres objet de cette convention, le personnel en activité relevant de L'Établissement E doit s'adresser aux agences commerciales d'Algérie Télécom, en fournissant les pièces suivantes :

Pour une nouvelle demande :
Une copie de la carte professionnelle ou la carte nationale d'identité, le cas échéant,
Attestation de travail. Une demande manuscrite ;
Une justification de l'adresse de l'employé ;

Pour un basculement :
Attestation de travail ou tout autre document d'éligibilité aux tarifs préférentiels document signé par les ressources humaines ;

Intervention technique à domicile : L’équipe technique se rend au domicile du client pour réaliser un diagnostic et identifie un problème lié au kit de branchement, qu'il soit intérieur ou extérieur. Les éléments suivants doivent être pris en compte lors du remplissage de la fiche d'intervention :
   - L'état de la défectuosité du kit ;
   - L'évaluation du type de câblage requis, en précisant la longueur nécessaire ;
   - Déterminer si le client est responsable du dérangement et obtenir son engagement pour l'achat du kit dans un délai de 48 heures. 4. Orientation de l’achat du kit de branchement : Le binôme remet au client une copie de la fiche d'intervention contenant les informations du client, le type de câble approprié, la distance du kit à remplacer. Cette action ne sera engagée que si, lors du diagnostic, l'équipe technique constate que la coupure du câble est à la responsabilité du client. En revanche, si la coupure est due à un facteur externe non imputable au client, la réparation sera assurée par les structures techniques d'Algérie Télécom. 5. Installation et rétablissement du service : Les techniciens s’engagent à intervenir dans un délai maximal de 48 heures après l’achat du kit pour effectuer l’installation et rétablir le service. 6. Gestion du délai d'achat du kit : Le client se rend ensuite à l'Agence Commerciale ou au Point de Présence pour finaliser l'achat du kit approprié dans les 48 heures suivant le diagnostic muni de la copie de la fiche d’intervention. L'agence commerciale informera le CMP/unité qualité de service client pour déclencher l'intervention des techniciens au domicile du client. Important : Si le client refuse l'achat du kit ou ne procède pas à son acquisition durant les 48 heures après le constat, l’orienteur procèdera à la clôture du ticket de dérangement. Le client sera informé que, sans l'achat du kit dans le délai imparti, le ticket sera automatiquement clôturé et il recevra un message de rétablissement. 7. Suivi : Les coordonnées du client ainsi que celles du responsable de l’unité de gestion de la qualité doivent figurer sur la fiche d’intervention.

