- UPLOAD est de 60% du débit ;
- Les Débits de 1 Gbps et 1.5 Gbps sont valables selon l'éligibilité ;
- Cette offre remplace et annule l’offre précédente. 4. Les nouveaux abonnés de l’offre Idoom Gamers locataire sont-ils tenus de souscrire à un contrat d’engagement ? En effet, les nouveaux abonnés sont tenus de s’engager pour une durée de 12 mois. 5. Quel est le dossier à fournir pour bénéficier de l’offre Gamers Locataire ? Pour bénéficier de l’offre, il suffit de fournir les documents suivants :
- Une copie de la pièce d’identité (La carte nationale d’identité ou le passeport en cours de validité) ;
- Document dont dispose le client pouvant confirmer l’adresse d’installation. 6. Est-ce que l'offre comprend un accès à idoom fixe ? Si oui, quel est le coût mensuel inclus ? En effet, L'offre comprend un accès idoom fixe au coût mensuel inclus de 250 Da. 7. Y a-t-il des restrictions concernant les appels internationaux avec cette offre ? Si oui, quel est le coût mensuel inclus ?
